import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button'

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
          <h1>Hello World!</h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
